* Author: Joshua Bijak
* Desc: Contract designed to hold the state of a Room containing LED contracts
* 
* 
* 
*/

import  '../../node_modules/openzeppelin-solidity/contracts/ownership/Ownable.sol';

import   '../LEDState/LEDState.sol';


contract RoomState is Ownable {

    //Lookup LED Contract Address for it's Creezy's address
    mapping(address => string) public coapAddressesCreezyPi;

    struct Group {
        uint256 count;
        address[] LEDs;
    }
    // Look up group by its coap address (aka all lights connected to a creezy), currently only for 1 universe
    // Packed as bytes from string
    mapping( bytes => Group) creezyUniverse;
    //Look up group by its "Group Designation" aka (Office Lights)
    // Packed as bytes from string


    mapping( bytes => Group) groupDesignator;

    //Struct To Hold Creezies

    struct CreezyPi {
        string coapAddress;
        uint256 numLEDs;
        uint256 numUniverses;

    }

    //Creezies in this Room
    uint256 public numCreezies =0;
    mapping( uint => CreezyPi ) public creezies;
    address[] newLEDs;

    event newRoom( uint256 numCreezies, address roomAddr);
    event newCreezy( uint256 numCreezies);
    event delCreezy( uint256 numCreezies);
    event newCreezyCoapAddr( uint256 numCreezies, string coapAddress);
    event newCreezyNumLEDs ( uint256 numCreezies, uint256 numLEDs);
    event newCreezyNumUniverses(  uint256 numCreezies, uint256 numUniverses);
    event newGroup(string groupID, uint256 _type);
    event groupDeleted( string groupID, uint256 _type);

    // constructor creates first Creezy. Creezies after are with Add Creezy function. 
    // Deploys the LED Contracts for its new Universe and registers them as group
    constructor(string memory _coapAddr,address contractOwner, uint256 _numLEDs, uint256 _numUniverses) public {



        creezies[numCreezies] = CreezyPi(_coapAddr, _numLEDs, _numUniverses);

        for (uint256 i=0; i<_numLEDs;i++){
            //Instantiate new contract and assign address with params (off, with 50% dim)
            LEDState LEDStateContract = new LEDState(false, address(this),contractOwner, i, 123);

            newLEDs.push(address(LEDStateContract));

        }
        //Create new type of universe type group
        addCreezyGroup(_coapAddr,newLEDs, 0);
        //Clear for future use
        address[] memory LEDClear;
        newLEDs = LEDClear;

        numCreezies = _numLEDs;

        emit newRoom(numCreezies, address(this));


    }
    function addCreezy(string memory _coapAddr, uint256 _numLEDs, uint256 _numUniverses) public onlyOwner {
        numCreezies = numCreezies++;

        creezies[numCreezies] = CreezyPi(_coapAddr, _numLEDs, _numUniverses);

        emit newCreezy(numCreezies);
    }
    /**
     *  Removes Creezy from Room. Unregisters Coap Address, must know creezy num prior
     */

    function removeCreezy(uint256 _creezyNum) public onlyOwner {


        delete creezies[_creezyNum];

        numCreezies = numCreezies--;

        emit delCreezy(numCreezies);
    }

    function updateCreezyCoap(uint256 _creezyNum, string memory _coapAddr) public onlyOwner {

        creezies[_creezyNum].coapAddress = _coapAddr;

        emit newCreezyCoapAddr(_creezyNum, creezies[_creezyNum].coapAddress);
    }
    function updateCreezyLEDs(uint256 _creezyNum, uint256 _new_numLEDs) public onlyOwner {
        creezies[_creezyNum].numLEDs = _new_numLEDs;

        emit newCreezyNumLEDs(_creezyNum, creezies[_creezyNum].numLEDs);

    }
    function updateCreezyUniverses(uint256 _creezyNum, uint256 _new_numUniverses) public onlyOwner {
        creezies[_creezyNum].numUniverses = _new_numUniverses;

        emit newCreezyNumUniverses(_creezyNum, creezies[_creezyNum].numUniverses);
    }
    // Create group based on Creezy or on new Designator "string"
    function addCreezyGroup(string memory _groupString, address[] memory LEDs, uint _type) public onlyOwner {

        bytes memory packedBytes = abi.encode(_groupString);

        if (_type == 0){
            creezyUniverse[packedBytes] = Group(LEDs.length, LEDs);
        }

        else if (_type ==1){
            groupDesignator[packedBytes] = Group(LEDs.length, LEDs);
        }

        emit newGroup(_groupString, _type);

    }
    // Remove 
    function removeGroup(string memory _groupString, uint256 _type) public onlyOwner {

        bytes memory packedBytes = abi.encode(_groupString);

        if (_type == 0){
            delete creezyUniverse[packedBytes];

        }
        else if (_type == 1){
            delete groupDesignator[packedBytes];

        }

        emit groupDeleted(_groupString, _type);
    }
    function getGroup(string memory _groupID, uint256 _type) public view returns(Group memory) {

        bytes memory packedBytes = abi.encode(_groupID);
        if (_type == 0){
            return creezyUniverse[packedBytes];
        }
        else if (_type == 1){
            return groupDesignator[packedBytes];
        }
    }

    //function updateGroup() public onlyOwner {}

}
